import { useSelector } from "react-redux"
import Day from "./Day"

const selectDays = state => state.categories.days

function Statistics() {

    const days = useSelector(selectDays)
    console.log("store", days)

    // Array of all days [{},{},{}]
    const daysValues = Object.values(days)
    console.log("days", daysValues)

    return (
        <div className=" mt-52 relative grid justify-center">
            <div className="text-4xl font-bold text-green-300 ">Statistics</div>
            {daysValues.map((day) => <Day key={day.id} id={day.id} categories={day.categories}/>)}
        </div>
    )

}

export default Statistics
